import React, { Component } from 'react';
import './Header.css';
import Title from './Title';
import Search from './Search';
import Logo from './Logo';
import Category from './Category';

 class Header extends Component {
    render() {
        return (
            <header>

            
            <Category></Category>
            <Logo></Logo>  
            <Title></Title>
            <Search></Search>

           
            </header>

        )
    }
}
export default Header;
